  const user = useSelector(state => state.user.data);

  const renderCadastro = () => (
    <View public={true}>
      <InitCadastro/>
    </View>
  );

  const direction = (user === true) ? (renderHome()) : (renderCadastro()) 

  return (
    <React.Fragment>
    {/* <View public={true}>
